    <Container fluid className="cnter d-flex-column justify-content-center pt-2">
      <h1 className="mb-4">¿Aun no estas registrado?</h1>
      <p>Registrate y disfrutaras de una experiencia más rápida de compra y venta de productos</p>

    <div className="d-flex justify-content-around">
      <div></div>
      <div></div>
    </div>


    </Container>
  )
}

export default Registro
